PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE utilizadores (
  user_id INTEGER PRIMARY KEY,
  First_Name TEXT,
  Last_Name TEXT,
  email INTEGER,
  password INTEGER,
  role INTEGER,
  groups INTEGER,
  rate_id REAL,
  active BOOLEAN,
  created_at TIMESTAMP,
  updated_at TIMESTAMP
);
CREATE TABLE groups (
  id INTEGER PRIMARY KEY,
  group_name TEXT,
  active BOOLEAN,
  created_at TIMESTAMP,
  updated_at TIMESTAMP
);
CREATE TABLE clients (
  client_id INTEGER PRIMARY KEY,
  name TEXT,
  group_id INTEGER,
  contact INTEGER,
  email INTEGER,
  active BOOLEAN,
  created_at TIMESTAMP,
  updated_at TIMESTAMP
);
CREATE TABLE projects (
  project_id INTEGER PRIMARY KEY,
  project_name TEXT,
  project_type TEXT,
  project_description TEXT,
  client_id INTEGER,
  start_date TIMESTAMP,
  end_date TIMESTAMP,
  hourly_rate REAL,
  total_hours REAL,
  total_cost REAL,
  status TEXT,
  group_id REAL,
  created_at TIMESTAMP,
  updated_at TIMESTAMP
, custo_realizado_mig REAL DEFAULT 0, horas_realizadas_mig REAL DEFAULT 0);
CREATE TABLE task_categories (
  task_category_id INTEGER PRIMARY KEY,
  task_category INTEGER,
  created_at TIMESTAMP,
  updated_at TIMESTAMP
);
CREATE TABLE activities (
  activity_id INTEGER PRIMARY KEY,
  activity_name TEXT,
  group_id INTEGER,
  active BOOLEAN,
  created_at TIMESTAMP,
  updated_at TIMESTAMP
);
CREATE TABLE rates (
  rate_id INTEGER PRIMARY KEY,
  rate_group_id INTEGER,
  rate_name TEXT,
  rate_cost REAL,
  active BOOLEAN,
  created_at TIMESTAMP,
  updated_at TIMESTAMP
);
CREATE TABLE timesheet (
  id INTEGER PRIMARY KEY,
  user_id INTEGER,
  group_id INTEGER,
  client_id INTEGER,
  project_id INTEGER,
  category_id INTEGER,
  task_id INTEGER,
  rate_user_id REAL,
  start_date TIMESTAMP,
  end_date TIMESTAMP,
  hours REAL,
  description TEXT,
  billable BOOLEAN,
  overtime BOOLEAN,
  total_hours REAL,
  approved BOOLEAN,
  activity_id REAL,
  updated_at TIMESTAMP,
  created_at TIMESTAMP,
  group_name REAL,
  rate_value REAL
);
CREATE TABLE absences (
  absence_id INTEGER PRIMARY KEY,
  user_id INTEGER,
  start_date TIMESTAMP,
  end_date TIMESTAMP,
  absence_type TEXT,
  description TEXT,
  status TEXT,
  approver_id REAL,
  approval_date TIMESTAMP,
  created_at TIMESTAMP,
  updated_at TIMESTAMP
);
CREATE TABLE travel_expenses (
  travel_id INTEGER PRIMARY KEY,
  user_id INTEGER,
  project_id INTEGER,
  client_id INTEGER,
  travel_date TIMESTAMP,
  travel_type TEXT,
  description TEXT,
  kilometers INTEGER,
  amount INTEGER,
  billable BOOLEAN,
  status TEXT,
  approver_id REAL,
  approval_date TIMESTAMP,
  created_at TIMESTAMP,
  updated_at TIMESTAMP
);
CREATE TABLE activity_groups (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                activity_id INTEGER NOT NULL,
                group_id INTEGER NOT NULL,
                FOREIGN KEY (activity_id) REFERENCES activities (activity_id),
                FOREIGN KEY (group_id) REFERENCES groups (id),
                UNIQUE (activity_id, group_id)
            );
CREATE TABLE annual_targets (
        target_id INTEGER PRIMARY KEY AUTOINCREMENT,
        company_name TEXT NOT NULL,
        target_value REAL NOT NULL,
        target_year INTEGER NOT NULL,
        created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
        updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
        UNIQUE(company_name, target_year)
    );
CREATE TABLE collaborator_targets (
        id INTEGER PRIMARY KEY AUTOINCREMENT,
        user_id INTEGER NOT NULL,
        year INTEGER NOT NULL,
        month INTEGER NOT NULL,
        billable_hours_target REAL NOT NULL,
        revenue_target REAL NOT NULL,
        company_name TEXT NOT NULL,
        created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
        updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
        UNIQUE(user_id, year, month),
        FOREIGN KEY(user_id) REFERENCES utilizadores(user_id)
    );
CREATE TABLE annual_targets_collaborators (
        id INTEGER PRIMARY KEY AUTOINCREMENT,
        target_id INTEGER NOT NULL,
        user_id INTEGER NOT NULL,
        created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
        FOREIGN KEY(target_id) REFERENCES annual_targets(target_id),
        FOREIGN KEY(user_id) REFERENCES utilizadores(user_id),
        UNIQUE(target_id, user_id)
    );
CREATE TABLE prospects (
            prospect_id INTEGER PRIMARY KEY AUTOINCREMENT,
            name TEXT NOT NULL,
            company TEXT NOT NULL,
            contact_name TEXT,
            email TEXT,
            phone TEXT,
            status TEXT NOT NULL,
            source TEXT,
            notes TEXT,
            assigned_to INTEGER,
            potential_value REAL,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            FOREIGN KEY(assigned_to) REFERENCES utilizadores(user_id)
        );
CREATE TABLE prospect_interactions (
            interaction_id INTEGER PRIMARY KEY AUTOINCREMENT,
            prospect_id INTEGER NOT NULL,
            user_id INTEGER NOT NULL,
            interaction_type TEXT NOT NULL,
            interaction_date TIMESTAMP NOT NULL,
            details TEXT,
            outcome TEXT,
            next_steps TEXT,
            next_contact_date TIMESTAMP,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            FOREIGN KEY(prospect_id) REFERENCES prospects(prospect_id),
            FOREIGN KEY(user_id) REFERENCES utilizadores(user_id)
        );
CREATE TABLE client_interactions (
            interaction_id INTEGER PRIMARY KEY AUTOINCREMENT,
            client_id INTEGER NOT NULL,
            user_id INTEGER NOT NULL,
            interaction_type TEXT NOT NULL,
            interaction_date TIMESTAMP NOT NULL,
            details TEXT,
            outcome TEXT,
            next_steps TEXT,
            next_contact_date TIMESTAMP,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            FOREIGN KEY(client_id) REFERENCES clients(client_id),
            FOREIGN KEY(user_id) REFERENCES utilizadores(user_id)
        );
CREATE TABLE opportunities (
            opportunity_id INTEGER PRIMARY KEY AUTOINCREMENT,
            prospect_id INTEGER,
            client_id INTEGER,
            title TEXT NOT NULL,
            description TEXT,
            status TEXT NOT NULL,
            stage TEXT NOT NULL,
            value REAL,
            probability INTEGER,
            expected_close_date TIMESTAMP,
            assigned_to INTEGER,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            FOREIGN KEY(prospect_id) REFERENCES prospects(prospect_id),
            FOREIGN KEY(client_id) REFERENCES clients(client_id),
            FOREIGN KEY(assigned_to) REFERENCES utilizadores(user_id)
        );
CREATE TABLE payments (
        payment_id INTEGER PRIMARY KEY AUTOINCREMENT,
        config_id INTEGER NOT NULL,
        payment_date DATE NOT NULL,
        amount REAL NOT NULL,
        invoice_number TEXT,
        payment_status TEXT NOT NULL,
        notes TEXT,
        created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
        updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
        FOREIGN KEY(config_id) REFERENCES billing_config(config_id)
    );
CREATE TABLE invoices (
            invoice_id INTEGER PRIMARY KEY AUTOINCREMENT,
            client_id INTEGER NOT NULL,
            project_id INTEGER NOT NULL,
            invoice_number TEXT NOT NULL,
            amount REAL NOT NULL,
            issue_date TIMESTAMP NOT NULL,
            payment_date TIMESTAMP NOT NULL,
            payment_method TEXT,
            notes TEXT,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            FOREIGN KEY (client_id) REFERENCES clients(client_id),
            FOREIGN KEY (project_id) REFERENCES projects(project_id)
        );
CREATE TABLE notes (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    content TEXT NOT NULL
  );
CREATE TABLE users (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    username TEXT UNIQUE NOT NULL,
    password TEXT NOT NULL
  );
COMMIT;
